pragma solidity ^0.8.0;
//SPDX-License-Identifier: MIT

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@1001-digital/erc721-extensions/contracts/RandomlyAssigned.sol";

// WeMint Washington Edition ERC721 
// WeMint.Cash 
// Calling mint mints a random  Washington until 10,000 have been minted. 

contract DollarArtNFT is ERC721, Ownable, RandomlyAssigned {
  using Strings for uint256;
  address public arthouse = 0x97843608a00e2bbc75ab0C1911387E002565DEDE;
  // uint256 public requested;

  string public baseURI = "https://ipfs.io/ipfs/";
  string internal baseExtension = ".json";
  uint256 public constant cost = 0.01 ether;
  uint256 public currentSupply = 0;
  uint256 public constant maxSupply = 10000;
  uint256 public constant maxMintAmountPerCall = 100;
  bool public paused = false;

  constructor() 
    ERC721("DollarArtNFT", "DART")
    RandomlyAssigned(10000,1)
    {
        mint(msg.sender, 49);
    }

  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }

  function mint (address _to, uint256 _amount)
      public
      payable
  {
      require( _amount > 0, "MUST MINT MORE THAN 0" );
      require(!paused, "CONTRACT CANNOT BE PAUSED");
      require( _amount <= maxMintAmountPerCall, "YOU CAN'T MINT SO MANY PER CALL");
      require( currentSupply + _amount <= maxSupply, "YOU CAN'T MINT MORE THAN MAXIMUM SUPPLY");
      require( availableTokenCount() - _amount > 0, "YOU CAN'T MINT MORE THAN AVALABLE TOKEN COUNT"); 

      if (msg.sender != owner()) {
        require( msg.value >= cost * _amount);
        (bool success,) = arthouse.call{value:_amount}("");
        require( success, "could not send");
      }

      for (uint256 i = 1; i <= _amount; i++) {
        uint256 id = nextToken();
        _safeMint(_to, id);
        currentSupply++;
      }      
  }

  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    require(
      _exists(tokenId),
      "ERC721Metadata: URI query for nonexistant token"
    );

    string memory currentBaseURI = _baseURI();
    return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension))
        : "";
  }

  function pauseMint(bool _state) public onlyOwner {
    paused = _state;
  }

  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function withdraw() public payable onlyOwner {
    require(payable(msg.sender).send(address(this).balance));
  }
}
